import React, { Component } from "react";
import { Line } from "react-chartjs-2";

class Graph extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: {
        labels: [
          "2020", "2021", "2022", "2023", "2024", "2025"
        ],
        datasets: [
          {
            label: "Population",
            data: [5000, 6000, 3503, 4038, 5639, 3400],
            backgroundColor: "cornflowerblue",
          },
        ],
      },
    };
  }


  render() {
    return (
      <div className="chart">
        <Line
          data={this.state.chartData}
          options={{
            title: {
              display: true,
              text: "OCBC",
              fontSize: 25
            },
            legend: {
              display: true,
              position: "right",
            },
          }}
        />
      </div>
    );
  }
}

export default Graph;
